import "./Style.css";


function NavBar() {
    return (
        <div className='NavBar'>
            <div className='HomeButton'>
                <button type="button" onClick={(e) => {
                    e.preventDefault();
                    window.location.href = '/';
                }}>Home</button>
            </div>


                <button type="button" onClick={(e) => {
                    e.preventDefault();
                    window.location.href = '/About';
                }}>About</button>


                <button type="button" onClick={(e) => {
                    e.preventDefault();
                    window.location.href = '/Recruitment';
                }}>Recruitment</button>


                <button type="button" onClick={(e) => {
                    e.preventDefault();
                    window.location.href = '/Project';
                }}>Projects</button>


                <button type="button" onClick={(e) => {
                    e.preventDefault();
                    window.location.href = '/';
                }}>Contacts</button>


        </div>
    );

}


export default NavBar;
